import React, { Component } from 'react';
//import { useState } from 'react';
import { Helmet } from 'react-helmet';
const discord = require('./icons/discord.png')
const youtube = require('./icons/youtube.png')
const github = require('./icons/github.png')
const python = require('./icons/python.png')
const java = require('./icons/java.png')
const c = require('./icons/c.png')
const mongodb = require('./icons/mongodb.png')
const sql = require('./icons/sql.png')
class Counter extends Component { 

    state={
        style:{
            

        }
    }
    render() { 

        return (
            <div className='bg-noob bg-no-repeat w-screen h-screen bg-cover'>
                <Helmet>
                    <title>Immortal</title>
                </Helmet>
                
                <h1 className='font-suk text-emerald-300 text-6xl text-center'>Hey there, I'm Ansh!</h1>
                <p className= 'font-par text-center py-3'>I am a full stack developer.I have made many minecraft plugins,Discord Bots, Arduino Projects,Websites,etc.
                    <br/>My main languages are Python, Java and I have worked with MongoDB,SQL,etc.
                </p>
                <div className='flex justify-center'>
                    <a href='https://discord.gg/gqp5nMzwTY' target='_blank' rel="noreferrer"><img src={discord} alt='discord' className='w-20 h-20 m-3 tooltip tooltip-open tooltip-bottom' data-tip='Join my Discord Server'/></a>
                    <a href='https://www.youtube.com/channel/UCgppWM8JtpTfEYp8sa8XHEw' target='_blank' rel="noreferrer"><img src={youtube} alt='discord' className='w-20 h-20 m-3'/></a>
                    <a href='https://github.com/Immortal-youtube' target='_blank' rel="noreferrer"><img src={github} alt='discord' className='w-20 h-20 m-3'/></a>
                    <a href='https://www.python.org' target='_blank' rel="noreferrer"><img src={python} alt='discord' className='w-20 h-20 m-3'/></a>
                    <a href='https://www.java.com/en/' target='_blank' rel="noreferrer"><img src={java} alt='discord' className='w-20 h-20 m-3'/></a>
                    <a href='https://en.wikipedia.org/wiki/C%2B%2B' target='_blank' rel="noreferrer"><img src={c} alt='discord' className='w-20 h-20 m-3'/></a>
                    <a href='https://www.mysql.com' target='_blank' rel="noreferrer"><img src={sql} alt='discord' className='w-20 h-20 m-3'/></a>
                    <a href='https://www.mongodb.com' target='_blank' rel="noreferrer"><img src={mongodb} alt='discord' className='w-20 h-20 m-3'/></a>
                    
                </div>
                
            </div>
        );
    }
    
}
 
export default Counter;
